// SellerDashboard.js

import React, { useState, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Container, Typography, Grid } from '@material-ui/core';
import { getPostsByCreator } from '../../actions/posts';

const SellerDashboard = () => {
  const dispatch = useDispatch();
  const user = useSelector((state) => state.auth?.user); // Assuming auth state contains user information

  useEffect(() => {
    if (user) {
      dispatch(getPostsByCreator(user.username)); // Assuming username is used to identify the seller
    }
  }, [dispatch, user]);

  // Render seller dashboard content here
  return (
    <Container>
      <Typography variant="h2" gutterBottom>
        Seller Dashboard
      </Typography>
      {/* Add more components to display posts, analytics, etc. */}
    </Container>
  );
};

export default SellerDashboard;
